import styled from 'styled-components';

export const FooterContainer = styled.footer`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  height: 25rem;
  background-color: #714836;
  color: #fcf9f8;
  margin-top: 2rem;
`;
